DROP TABLE IF EXISTS `yamlGraphicIDs`;
CREATE TABLE `yamlGraphicIDs` (
  `graphicID` int(11) NOT NULL DEFAULT '0',
  `description` varchar(256) DEFAULT NULL,
  `graphicFile` varchar(512) DEFAULT NULL,
  `sofFactionName` varchar(128) DEFAULT NULL,
  `sofHullName` varchar(128) DEFAULT NULL,
  `sofRaceName` varchar(128) DEFAULT NULL
) ENGINE=MyISAM DEFAULT CHARSET=utf8;


DROP TABLE IF EXISTS `yamlTypeIDs`;
CREATE TABLE `yamlTypeIDs` (
  `typeID` int(11) NOT NULL,
  `graphicID` int(11) DEFAULT NULL,
  `iconID` int(11) DEFAULT NULL,
  `factionID` int(11) DEFAULT NULL,
  `radius` decimal(30,2) DEFAULT NULL,
  `soundID` int(11) DEFAULT NULL
) ENGINE=MyISAM DEFAULT CHARSET=utf8;


ALTER TABLE `yamlGraphicIDs`
  ADD PRIMARY KEY (`graphicID`);

ALTER TABLE `yamlTypeIDs`
  ADD PRIMARY KEY (`typeID`);